import css from "../../scss/home/body.module.scss";

const Body = () => {
  console.log(css);
  return (
    <div className="body">
      <div className="top">
        <div className={css.left}>
          <input type="text" className={css.nnn} />
        </div>
        {/* /.left */}
        <div className={css.middle}>
          <ul className="body-nav list-unstyled d-flex">
            <li className="body-nav-item">All</li>
            <li className="body-nav-item">Networking</li>
            <li className="body-nav-item">Business</li>
            <li className="body-nav-item">Men&amp;Mice</li>
            <li className="body-nav-item">Events</li>
            <li className="body-nav-item">Courses</li>
          </ul>
          {/* /.body-nav */}
        </div>
        {/* /.moddle */}
        <div className={css.right}>
          <div className={css.sort}>
            <span>Sort by: </span>
            <button className={css.sortButton}>Newest</button>
          </div>
        </div>
        {/* /.right */}
      </div>
      {/* /.top */}
      <div className="bottom">
        <div className="left"></div>
        {/* /.left */}
        <div className="middle"></div>
        {/* /.moddle */}
        <div className="right"></div>
        {/* /.right */}
      </div>
      {/* /.bottom */}
      <style jsx>
        {`
          .top {
            opacity: 0;
          }
        `}
      </style>
    </div>
  );
};

export default Body;
